import { useContext } from "react"
import { Boss } from "./Puplic"

export default function Mapping() {
  const {jok} = useContext(Boss)

  return (
    <ul>
 {jok.map(x => {
    <li key={x.id}>
    <span>{x.image}</span>
    </li>
 })}
 <button className="btn bg-primary m-5">Clear All</button>
    </ul>
  )
}
